  const [objLista1, setObjLista1] = useState([]);
  const [objLista2, setObjLista2] = useState([]);
  const [value, setValue] = useState(["Emberi test"]);

  useEffect(() => {
    DB.getData("/szavak/1", setObjLista1);
    DB.getData("/szavak/2", setObjLista2);
  }, []);
}
